      SELECT + 83 AS col2, - MIN ( DISTINCT - 12 ) + + CASE + - COALESCE ( + ( + 48 ), - - 42 * 1, - 22 ) WHEN - + 38 / - + COUNT ( * ) THEN - 36 END AS col0;

outputs:
